import { useParams } from 'react-router-dom';

const QuotesDetail = () => {
    const params = useParams();

    return (
        <Fragment>
            <h1>Quote Detail Page</h1>
            <p>{params.quote}</p>

        </Fragment>
    )

}
export default QuotesDetail;
